import React, {useState} from 'react';

const strike = {
 textDecoration: 'line-through'
}

const ToDo = ({todo}) => {
    return (
        <div className={todo.complete ? style={strike} : ""}>
           {todo.task}
       </div>
    );
};

export default ToDo;
